import React from 'react';
import { Routes, Route} from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Shop from './pages/Shop';
import Navbar from './pages/Navbar';
import './App.css';

function App() {
  return (
      <>
        <Navbar/>
        <Routes>

          <Route path='/About' element={<About
          head="About Us"
          para="Welcome to our premier online bookstore destination, where shopping for books is transformed into an exceptional experience. With an extensive selection of best seller books, a user-friendly interface, and a commitment to security, we offer a seamless shopping journey for books. Our dedicated customer service and exclusive discounts ensure you receive the best service. Join our vibrant community of shoppers and discover why we're the go-to choice for online retail."
          />}/>
          <Route path='/' element={<Home
           headpara="Introducing Book Stack, a cutting-edge e-commerce platform that delivers numerous types of products types of books to your doorstep."
           head="Welcome to Book Stack." 
           headtwo="A better way to shop anywhere on Earth."
           headtwopara="This website offers you an elevated and more convenient shopping experience, allowing you to browse and make purchases with greater ease and satisfaction."
           btn="Shop"
           midscript="Up For Some Shopping?"
           moonscript="You have the power to place orders right from the moon's serene surface, adding a touch of celestial wonder to your shopping experience."
           />}/>
          <Route path='/Shop' element={<Shop/>}/>
        </Routes>
      </>
  );
}

export default App;
